import { useState,useEffect } from 'react';
import axios from 'axios';
import { useNavigate,useParams } from 'react-router-dom';
import Managerdropdown from './Managerdropdown';
function Assigntask(props) {
    const navigate = useNavigate();
   
    const [task, setTask] = useState(
        {
            emailId:"",
            taskName: "",
            description: "",
            dueDate: "",
            memailId:"",
        }
    )
   
    const[isFormValid,setIsFormValid]=useState(false);
    const[errors,setErrors]=useState({});

    const validateForm =()=>{
        const errors={};
        if(!emailId){
            errors.emailId='Email is required';
        }
        else if (!/\S+@\S+\.\S+/.test(emailId)) {
            errors.emailId = 'Email is invalid';
       }
        if(!dueDate){
            errors.dueDate='fromDate is required';
        }
        if(!taskName){
            errors.taskName='taskName is required';
        }
        if(!description){
            errors.description='description is required';
        }
       
       
        if(!memailId){
            errors.memailId='Email is required';
        }
        else if (!/\S+@\S+\.\S+/.test(emailId)) {
            errors.emailId = 'Email is invalid';
       }
      
        setErrors(errors);
        setIsFormValid(Object.keys(errors).length===0);
    };
       
     const{emailId}=useParams;
    const { taskName, description,  dueDate,memailId } = task
  
    const onInputChange = (e) => {
        setTask({
            ...task,
            [e.target.name]: e.target.value
        });
    }

    const handleSubmit = async (e) => {
        e.preventDefault();
        await axios.post(`http://localhost:9010/task/${emailId}`, task
        )
            .then(res => {
                console.log(res.data)
                if (res.status === 404) {
                    alert(res.data)
                }
                window.location.href = "/managerhome";
            })
            .catch(error => {
                console.log(error);
                if(error.response && error.response.status===500){
                    alert("Incorrect data");
                }
            })
        // navigate("/managerhome");

    };

    return (
        <div>
           <Managerdropdown></Managerdropdown>
            <div className="container" >
                <div className="row">
                    <div className="col-md-6 offset-md-3 border rounded p-4 mt-2 shadow">
                        <h2 className="text-center m-4"> Assign Task</h2>
                        <form onSubmit={(e) => handleSubmit(e)} >
                        <div className="mb-3">
                                <label htmlFor="emailId" className="form-label">EmailId</label>
                                <input
                                    type={"email"}
                                    className="form-control"
                                    placeholder="Enter your emailid"
                                    name="emailId"
                                    value={emailId}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            <div className="mb-3">
                                <label htmlFor="memailId" className="form-label">memailId</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter yourManager emailId"
                                    name="memailId"
                                    value={memailId}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            <div className="mb-3">
                                <label htmlFor="taskName" className="form-label">TaskName</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter your taskName"
                                    name="taskName"
                                    value={taskName}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            <div className="mb-3">
                                <label htmlFor="description" className="form-label">Manager EmailId</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter description"
                                    name="description"
                                    value={description}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            <div className="mb-3">
                            <label htmlFor="dueDate" className="form-label">Due Date</label>
                                <input
                                    type={"Date"}
                                    className="form-control"
                                    placeholder="Enter your Date"
                                    name="dueDate"
                                    value={dueDate}
                                    onChange={onInputChange}
                                ></input>
                               
                            </div>
       
                            <button type="submit" className="btn btn-outline-info">Submit</button>
                            {/* <Link to="/"type="submit" className="btn btn-success">Submit</Link> */}
                            
                        </form>
                    </div>

                </div>
            </div>
        </div>
    );
}

export default Assigntask;
